                    <p>TYPES</p>
                </div>
                <img src="" alt="Sprite" srcset="" />
                <div>
                    <button>PREVIOUS</button>
                    <button>NEXT</button>
                </div>
            </div>
        </main>
    );
}

export default Lista;
